export const getPPFontSize = (rate: number, webSize: string) => {
  return Math.floor(Number(webSize) * rate - 5) + "px";
};

export const getPPElementSize = (
  rate: number,
  webSize: string,
  isPx: boolean = true
) => {
  let symbol = isPx ? "px" : "%";
  return Math.floor(Number(webSize) * rate) + symbol;
};

